import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
    const navigate = useNavigate();

    const handleLoginEntry = (role) => {
        // Filhal hum dono ko Dashboard par bhej rahe hain.
        // Future mein hum yahan check karenge ke agar 'admin' hai to admin panel khule, etc.
        console.log(`Entering as: ${role}`);
        navigate('/dashboard');
    };

    return (
        <div style={styles.container}>
            {/* Animated Background Effect */}
            <div style={styles.overlay}></div>

            <div style={styles.contentBox}>
                {/* Title Section */}
                <h1 style={styles.title}>
                    üõ°Ô∏è DeepGuard <span style={styles.version}>Enterprise</span>
                </h1>
                <p style={styles.subtitle}>Next-Gen AI Video Forensics & Threat Detection System</p>

                <div style={styles.divider}></div>

                <h3 style={{ color: '#cbd5e1', marginBottom: '30px' }}>Select Identify for Access</h3>

                {/* Login Options Buttons */}
                <div style={styles.buttonContainer}>
                    {/* Admin Button */}
                    <button 
                        style={styles.adminButton} 
                        className="login-btn admin-btn"
                        onClick={() => handleLoginEntry('admin')}
                    >
                        <div style={{ fontSize: '30px', marginBottom: '10px' }}>üë®‚Äçüíª</div>
                        <div>Admin Access</div>
                        <small style={{ color: '#94a3b8', fontSize: '12px' }}>System Configuration & Logs</small>
                    </button>

                    {/* User Button */}
                    <button 
                        style={styles.userButton} 
                        className="login-btn user-btn"
                        onClick={() => handleLoginEntry('user')}
                    >
                        <div style={{ fontSize: '30px', marginBottom: '10px' }}>üë§</div>
                        <div>User Login</div>
                        <small style={{ color: '#94a3b8', fontSize: '12px' }}>Video Analysis Dashboard</small>
                    </button>
                </div>
            </div>

            {/* CSS Animations */}
            <style>{`
                @keyframes fadeIn { from { opacity: 0; transform: translateY(20px); } to { opacity: 1; transform: translateY(0); } }
                @keyframes glow { 0% { text-shadow: 0 0 10px #38bdf8; } 50% { text-shadow: 0 0 25px #38bdf8, 0 0 40px #2563eb; } 100% { text-shadow: 0 0 10px #38bdf8; } }
                
                .login-btn { transition: all 0.4s ease; }
                .login-btn:hover { transform: translateY(-5px) scale(1.03); cursor: pointer; }
                
                .admin-btn:hover { box-shadow: 0 10px 30px -5px rgba(239, 68, 68, 0.5); border-color: #ef4444 !important; }
                .user-btn:hover { box-shadow: 0 10px 30px -5px rgba(56, 189, 248, 0.5); border-color: #38bdf8 !important; }
            `}</style>
        </div>
    );
};

// Styles Object
const styles = {
    container: {
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#020617', // Very dark blue/black background
        backgroundImage: 'radial-gradient(circle at center, #1e293b 0%, #020617 100%)',
        position: 'relative',
        overflow: 'hidden',
        color: 'white',
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif"
    },
    overlay: {
        position: 'absolute',
        top: 0, left: 0, right: 0, bottom: 0,
        backgroundImage: 'linear-gradient(rgba(56, 189, 248, 0.1) 1px, transparent 1px), linear-gradient(90deg, rgba(56, 189, 248, 0.1) 1px, transparent 1px)',
        backgroundSize: '50px 50px', // Cyberpunk grid effect
        pointerEvents: 'none'
    },
    contentBox: {
        textAlign: 'center',
        zIndex: 2,
        animation: 'fadeIn 1s ease-out',
        padding: '40px',
        borderRadius: '20px',
        backgroundColor: 'rgba(15, 23, 42, 0.6)', // Semi-transparent box
        backdropFilter: 'blur(10px)', // Glass effect
        border: '1px solid rgba(56, 189, 248, 0.2)',
        boxShadow: '0 25px 50px -12px rgba(0, 0, 0, 0.5)'
    },
    title: {
        fontSize: '4rem',
        margin: '0',
        color: 'white',
        fontWeight: '800',
        letterSpacing: '-2px',
        animation: 'glow 3s infinite ease-in-out'
    },
    version: {
        fontSize: '1.5rem',
        color: '#38bdf8',
        fontWeight: 'normal',
        verticalAlign: 'middle'
    },
    subtitle: {
        color: '#94a3b8',
        fontSize: '1.2rem',
        marginTop: '10px'
    },
    divider: {
        height: '2px',
        width: '100px',
        backgroundColor: '#334155',
        margin: '30px auto'
    },
    buttonContainer: {
        display: 'flex',
        gap: '20px',
        justifyContent: 'center',
        marginTop: '30px'
    },
    adminButton: {
        padding: '30px',
        borderRadius: '15px',
        border: '2px solid #7f1d1d',
        backgroundColor: 'rgba(127, 29, 29, 0.2)',
        color: '#fca5a5',
        width: '220px',
        textAlign: 'center',
        fontSize: '1.1rem',
        fontWeight: 'bold'
    },
    userButton: {
        padding: '30px',
        borderRadius: '15px',
        border: '2px solid #0369a1',
        backgroundColor: 'rgba(3, 105, 161, 0.2)',
        color: '#7dd3fc',
        width: '220px',
        textAlign: 'center',
        fontSize: '1.1rem',
        fontWeight: 'bold'
    }
};

export default LandingPage;
